import img2 from "../src/image/sad4.png";
import img1 from "../src/image/sad2.png";
import img3 from "../src/image/sad3.png";
import img4 from "../src/image/sad4.png";
import img5 from "../src/image/sad3.png";
import img6 from "../src/image/sad2.png";

const Sdata = [
    {
    imgsrc: img1,
    title: "SK Technical",
    },
    {
    imgsrc: img2,
    title: "Fun Land",
    },
    {
    imgsrc: img3,
    title: "Sk Compeney",
    },
    {
    imgsrc: img4,
    title: "Amazing Photo",
    },
    {
    imgsrc: img5,
    title: "Webkit photo",
    },
    {
    imgsrc: img6,
    title: "Webkit photo",
    },
];

export default Sdata;
